import { Nav, Navbar } from 'react-bootstrap';

function Navi () {
    return (
        <Navbar bg="dark">
            <Nav bg="dark"
                activeKey="/home"
            >
                <Nav.Item>
                    <Nav.Link href="/home">Home</Nav.Link>
                </Nav.Item>
                <Nav.Item>
                    <Nav.Link href="/order">Orders</Nav.Link>
                </Nav.Item>
            </Nav>
        </Navbar>
        
    );
}

export default Navi;
